«Транснефть» — российская транспортная монополия, оператор магистральных нефтепроводов России.

Основные направления деятельности:
- транспортировка нефти и нефтепродуктов по трубопроводной системе на территории России и за её пределами;
- диагностические, профилактические и аварийно-восстановительные работы;
- координация деятельности по комплексному развитию сети магистральных трубопроводов и других объектов трубопроводного транспорта.

